import React from 'react'
import {IoIosArrowForward,IoIosArrowBack} from 'react-icons/io'
 function Navigators() {
    return (
        <div>
                        <IoIosArrowBack/>

            <IoIosArrowForward/>
        </div>
    )
}

export default Navigators
